import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <div className='header'>
        Portfolio
        <nav>
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>

                <li>
                    <Link to="/about">About</Link>
                </li>

                <li>
                    <Link to="/achievements">Achievements</Link>
                </li>
            </ul>
        </nav>
    </div>
  )
}

export default Header;
